import * as React from "react";
import "./Experience.css";
import logo from "../../Images/tillsterlogo.jpeg";
import info from "../../Images/tillster.png";
import taxfyle from "../../Images/tax.png";
import gw from "../../Images/gw.png";
import iphone from "../../Images/iphone.png";

import Divider from "@mui/material/Divider";
import Box from "@mui/material/Box";
function Experience() {
  const [showTillster, setShowTillster] = React.useState(true);
  const [showTaxfyle, setShowTaxfyle] = React.useState(false);
  const [showRadio, setShowRadio] = React.useState(false);
  const [count, setCount] = useState(0);
  const [showMagazine, setShowMagazine] = React.useState(false);
  return (
    <div id="experience">
      <h3 className="header">Experience</h3>
      <div className="hero">{showTillster && <h4>Tillster</h4>}</div>
      <div className="gridTitles">
        <button onClick={() => setCount(0)} className="text">
          <Divider sx={{ borderBottomWidth: 2 }} />
          <h4>Tillster</h4>
          <h6>2021 - Present</h6>
        </button>
        <button onClick={() => setCount(1)} className="text">
          <Divider sx={{ borderBottomWidth: 2 }} />
          <h4>Taxfyle</h4>
          <h6>2019 - 2020</h6>
        </button>
        <button onClick={() => setCount(2)} className="text">
          <Divider sx={{ borderBottomWidth: 2 }} />
          <h4>UMVUM</h4>
          <h6>2018 - 2021</h6>
        </button>
        <button onClick={() => setCount(3)} className="text">
          <Divider sx={{ borderBottomWidth: 2 }} />
          <h4>Graphic Design Final Magazine</h4>
          <h6>2021</h6>
        </button>
      </div>
    </div>
  );
}
export default Experience;
